serverConfig.stream().map(v -> {
  var envBuilder=new EnvVarBuilder().withName(getEnvVarName(v.getName()));
  var secret=v.getSecret();
  if (secret != null) {
    envBuilder.withValueFrom(new EnvVarSourceBuilder().withSecretKeyRef(secret).build());
    serverConfigSecretsNames.add(secret.getName());
  }
 else {
    envBuilder.withValue(v.getValue());
  }
  return envBuilder.build();
}
).collect(Collectors.toList())

