  JWKBuilder b=JWKBuilder.create().kid(k.getKid()).algorithm(k.getAlgorithm());
  if (k.getType().equals(KeyType.RSA)) {
    return b.rsa(k.getPublicKey(),k.getCertificate());
  }
 else   if (k.getType().equals(KeyType.EC)) {
